import { BrowserRouter, Route, Routes, useNavigate } from 'react-router-dom'
import { Footer } from '../Footer'
import NotFound from '../NotFound'
import  CompanyAddCoupon  from './CompanyAddCoupon'
import CompanyDeleteCoupon from './CompanyDeleteCoupon'
import CompanyGetAllCoupons from './CompanyGetAllCoupons'
import CompanyGetCouponsByCategory from './CompanyGetCouponsByCategory'
import CompanyGetCouponsByMaxPrice from './CompanyGetCouponsByMaxPrice'
import CompanyGetDetails from './CompanyGetDetails'
import { NavBarCompany } from './NavBarCompany'

interface Props {
  token?: string,
  id?: number; // make id prop optional
}

export const HomeCompany = (props: Props) => {
  const navigate = useNavigate();
  const handleGoBack = () => {
    navigate(-1);
  };

  return (
    <div className="HomeAdmin">
      <button onClick={handleGoBack}>Go back</button>
      // ... rest of your code
    </div>
  );
};

const App = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<HomeCompany />} />
        <Route path='/addCoupon' element={<CompanyAddCoupon />} />
        <Route path='/updateCoupon' element={<CompanyUpdateCoupon />} />
        <Route path='/getCoupons/all' element={<CompanyGetAllCoupons />} />
        <Route path='/deleteCoupon' element={<CompanyDeleteCoupon />} />
        <Route path='/getCoupons/category' element={<CompanyGetCouponsByCategory />} />
        <Route path='/getCoupons/maxToPay' element={<CompanyGetCouponsByMaxPrice />} />
        <Route path='/getDetails' element={<CompanyGetDetails />} /> 
        <Route path='*' element={<NotFound />} />
      </Routes> 
      <Footer />
    </BrowserRouter>
  );
}

export default App;
